import React from 'react';
import { Route, Redirect } from 'react-router-dom';

export default function PrivateRoute ({accountTypeUser, accountTypeComponent, children, show, ...rest}) {
    alert(`BEFORE: ${accountTypeUser} ${JSON.stringify(show())}`)
    return (
      <Route
        {...rest}
        render={(props) => accountTypeUser === accountTypeComponent
          ? children
          : <Redirect to='/login'/>}
      />
    )
  }
